(30, 5, 'Este carro ofrece un rendimiento impresionante. Es cómodo, eficiente y tiene una excelente relación calidad-precio. Ideal para viajes largos o uso diario.', 7, 10, '2024-11-11 17:53:09'),
(31, 5, 'Llevo varios meses con el auto y ha sido muy confiable. No he tenido ningún problema mecánico y su manejo es suave. Definitivamente una excelente compra.', 7, 4, '2024-11-11 17:53:31'),
(32, 2, 'Lamentablemente, este coche ha sido una gran decepción. Desde que lo compré, ha tenido varios problemas mecánicos y ha requerido reparaciones frecuentes. No lo recomendaría.', 7, 3, '2024-11-11 17:53:46'),
(33, 1, 'Los materiales del interior se sienten baratos. Después de unos meses de uso, he notado que algunos acabados ya están desgastados o dañados. No es lo que esperaba de un coche de esta gama.', 7, 9, '2024-11-11 17:54:04'),
(34, 3, 'Es muy cómodo para viajes largos y tiene un gran sistema de seguridad, pero el rendimiento en términos de aceleración y velocidad no es el mejor. Se queda un poco atrás en comparación con otros modelos.', 7, 1, '2024-11-11 17:54:22'),
(35, 3, 'Es muy cómodo para viajes largos y tiene un gran sistema de seguridad, pero el rendimiento en términos de aceleración y velocidad no es el mejor. Se queda un poco atrás en comparación con otros modelos.', 7, 5, '2024-11-11 17:55:36'),
(36, 3, 'Es muy cómodo para viajes largos y tiene un gran sistema de seguridad, pero el rendimiento en términos de aceleración y velocidad no es el mejor. Se queda un poco atrás en comparación con otros modelos.', 8, 5, '2024-11-11 17:55:42'),
(37, 3, 'El coche cumple con su propósito, pero la tecnología que incluye es bastante básica comparada con otros modelos en el mercado. Sin embargo, no me arrepiento de la compra.', 8, 6, '2024-11-11 17:55:54'),
(38, 3, 'El coche es bastante bueno por el precio. Sin embargo, tiene algunos detalles que podrían mejorar, como la comodidad de los asientos y el rendimiento del sistema de sonido.', 8, 7, '2024-11-11 17:56:13'),
(39, 4, 'El espacio interior es muy limitado, especialmente en los asientos traseros. No es cómodo para viajes largos, especialmente si tienes una familia grande o necesitas cargar muchas cosas.', 8, 2, '2024-11-11 17:56:30'),
(40, 2, 'Este auto consume demasiada gasolina. A pesar de ser relativamente nuevo, no es nada eficiente en cuanto a combustible, lo que lo hace costoso para viajes largos.', 8, 4, '2024-11-11 17:56:47'),
(41, 2, 'No he tenido problemas con el mantenimiento hasta ahora, lo cual es un alivio. El auto es duradero y fácil de mantener. Lo recomendaría sin duda', 8, 10, '2024-11-11 17:57:04'),
(42, 2, 'No he tenido problemas con el mantenimiento hasta ahora, lo cual es un alivio. El auto es duradero y fácil de mantener. Lo recomendaría sin duda', 9, 1, '2024-11-11 17:58:55'),
(43, 2, 'En carretera, el auto es muy inestable. La dirección es imprecisa y a altas velocidades da la sensación de no tener el control total. No lo recomendaría para viajes largos.', 9, 4, '2024-11-11 17:59:13'),
(44, 4, 'El diseño es moderno y la comodidad es excelente, pero el consumo de gasolina es mucho más alto de lo que esperaba. Si no te importa eso, es una opción razonable.', 9, 7, '2024-11-11 17:59:30'),
(45, 5, 'Tiene mucho espacio y es cómodo para toda la familia, pero la suspensión no es tan suave como esperaba. A veces, las imperfecciones de la carretera se sienten más de lo que debería.', 9, 8, '2024-11-11 17:59:49'),
(46, 5, 'El diseño es sofisticado y moderno, lo que hace que el coche se vea increíble. Es un placer conducirlo y siempre recibe cumplidos por su apariencia.', 9, 5, '2024-11-11 18:00:05'),
(47, 4, 'El diseño es sofisticado y moderno, lo que hace que el coche se vea increíble. Es un placer conducirlo y siempre recibe cumplidos por su apariencia.', 10, 7, '2024-11-11 18:00:26'),
(48, 4, 'El confort de este auto es excelente. Tiene un interior muy cómodo, y lo mejor es lo silencioso que es cuando conduces. Perfecto para trayectos largos..', 10, 2, '2024-11-11 18:01:03'),
(49, 2, 'He tenido varios problemas con la transmisión. El cambio de marchas es muy brusco y a veces tarda en responder. No esperaba este tipo de inconvenientes en un auto nuevo.', 10, 9, '2024-11-11 18:01:22'),
(50, 1, 'El interior es incómodo, y el motor es increíblemente ruidoso. Además, el coche vibra demasiado al acelerar, lo que hace que el viaje sea muy desagradable.', 10, 3, '2024-11-11 18:01:39'),
(51, 5, 'Este carro ofrece un rendimiento impresionante. Es cómodo, eficiente y tiene una excelente relación calidad-precio. Ideal para viajes largos o uso diario.', 10, 1, '2024-11-11 18:01:59'),
(52, 5, 'Esta cafetera prepara un café delicioso y fuerte en solo unos minutos. Me encanta la opción de ajustar la intensidad del café. ¡Muy feliz con mi compra!', 11, 1, '2024-11-11 18:04:25'),
(53, 5, 'Me encanta la capacidad de la cafetera. Es perfecta para preparar varias tazas a la vez. Ideal si tienes una familia o recibes visitas.', 11, 3, '2024-11-11 18:04:36'),
(54, 4, 'Por su precio, esta cafetera cumple perfectamente su función. El café es delicioso y es muy fácil de mantener', 11, 5, '2024-11-11 18:05:00'),
(55, 2, 'La limpieza es un dolor de cabeza. Se acumulan restos de café y es difícil llegar a algunas partes para limpiarlas adecuadamente.', 11, 7, '2024-11-11 18:05:15'),
(56, 1, 'El café tiene un sabor raro, como metálico. Probé con diferentes tipos de café, pero siempre tiene un sabor extraño. No me ha gustado para nada.', 11, 9, '2024-11-11 18:05:30'),
(57, 1, 'La cafetera se apaga sola después de unos minutos, lo cual es muy incómodo. He tenido que reiniciarla varias veces. No es lo que esperaba.', 11, 10, '2024-11-11 18:05:47'),
(58, 1, 'El material parece barato, y la waflera no se siente resistente. Después de un par de usos, comenzó a dar señales de desgaste.', 12, 8, '2024-11-11 18:06:28'),
(59, 1, 'Las placas son pequeñas, lo que hace que los waffles sean bastante pequeños. No es ideal para familias o si tienes invitados.', 12, 6, '2024-11-11 18:06:41'),
(60, 4, 'La limpieza es muy fácil gracias a su recubrimiento antiadherente. Los waffles no se quedan pegados y el exceso de masa se retira sin esfuerzo.', 12, 4, '2024-11-11 18:06:56'),
(61, 5, 'La waflera calienta rápido y los waffles quedan esponjosos por dentro y crujientes por fuera. Ideal para un desayuno rápido y delicioso.', 12, 2, '2024-11-11 18:07:07'),
(62, 4, 'Esta licuadora es muy potente, licúa todo en segundos. Hago batidos y smoothies en un abrir y cerrar de ojos. ¡Excelente rendimiento!', 13, 6, '2024-11-11 18:10:33'),
(63, 5, 'El diseño es moderno y resistente. El vaso es grande, perfecto para preparar grandes cantidades, y el motor es muy eficiente.', 13, 7, '2024-11-11 18:10:47'),
(64, 5, 'Me sorprendió lo silenciosa que es en comparación con otras licuadoras. Aún licuando ingredientes duros, el motor funciona sin hacer demasiado ruido.', 13, 8, '2024-11-11 18:11:01'),
(65, 3, 'La licuadora se calienta rápidamente y se apaga tras unos minutos de uso. No es lo suficientemente duradera para licuados largos..', 13, 1, '2024-11-11 18:11:15'),
(66, 1, 'El vaso de la licuadora se rompió después de unos meses de uso. El material es muy frágil y no me parece adecuado para el uso diario.', 13, 9, '2024-11-11 18:11:33'),
(67, 1, 'Es bastante difícil de limpiar. El diseño no permite acceder a todas las partes fácilmente, por lo que siempre quedan restos de comida.', 13, 10, '2024-11-11 18:11:48'),
(68, 4, 'Es bastante difícil de limpiar. El diseño no permite acceder a todas las partes fácilmente, por lo que siempre quedan restos de comida.', 14, 2, '2024-11-11 18:13:26'),
(69, 5, 'El motor es potente y, lo mejor, es que es silencioso. No hace ruido excesivo y extrae el jugo rápidamente.', 14, 3, '2024-11-11 18:13:39'),
(70, 5, 'Perfecto para hacer jugo de naranja. La cantidad de jugo que obtengo es mucho mayor que con otros exprimidores que he tenido.', 14, 4, '2024-11-11 18:13:50'),
(71, 1, 'Las piezas son de plástico frágil y se rompieron después de poco uso. No es duradero.', 14, 5, '2024-11-11 18:14:25'),
(72, 1, 'El exprimidor no saca todo el jugo de las frutas. A menudo queda mucha pulpa y no es tan eficiente como otros modelos que he probado..', 14, 7, '2024-11-11 18:14:40'),
(73, 4, 'Es increíble lo bien que queda la comida, ¡sin usar apenas aceite! Sabe como frita, pero mucho más saludable.', 15, 10, '2024-11-11 18:15:33'),
(74, 4, 'El diseño es muy bonito y ocupa poco espacio en la cocina. Es ideal para quienes tienen poco espacio pero quieren una freidora de aire potente.', 15, 7, '2024-11-11 18:15:49'),
(75, 2, 'La comida no se cocina de manera uniforme. A menudo tengo que moverla varias veces para que se cocine bien.', 15, 4, '2024-11-11 18:16:21'),
(76, 1, 'Es bastante pequeña, por lo que no es ideal si cocinas para varias personas. Tengo que hacer muchas tandas para preparar la comida.', 15, 3, '2024-11-11 18:16:36'),
(77, 1, 'La freidora se sobrecalienta después de un par de usos, y eso hace que el rendimiento disminuya. No me ha durado tanto como esperaba.', 15, 1, '2024-11-11 18:16:50'),
(78, 4, 'Muy buen producto facil de usar y no consume tanta energia', 23, 2, '2024-11-11 22:57:25'),
(79, 5, 'Muy buena camara, excelente calidad!!', 3, 2, '2024-11-12 00:15:02'),
(80, 5, 'Muy buen carro para viajes largos y con gran sistema de seguridad.', 7, 2, '2024-11-12 00:22:45'),
(81, 5, 'Muy buen kit de pesas perfecto para el dia de gym.', 20, 11, '2024-11-12 00:32:01');
INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(1, 'Redmi Note 13 pro', 'Capacidad y eficiencia\r\nCon su potente procesador y memoria RAM de 16 GB tu equipo alcanzará un alto rendimiento con gran velocidad de transmisión de contenidos y ejecutará múltiples aplicaciones a la vez sin demoras.\r\n\r\nDesbloqueo facial y dactilar\r\nMáxi', 847408, 'Xiaomi', , 1),
(2, 'Monitor Gamer IPS 27\"', 'MONITOR HP M27F\r\nExtiende tus aplicaciones, disfruta tus series favoritas y haz un impacto positivo en el medio ambiente, todo esto al utilizar el monitor HP ultradelgado, con pantalla de micro bordes y resolución Full HD IPS, que incluye un 85% de compon', 559999, 'HP', , 1);
INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(3, 'Cámara Profesional', 'El sensor y el sistema de procesamiento totalmente renovados mejoran aún más la calidad de la imagen. El rendimiento general del enfoque automático mejorado, la captura continua a alta velocidad de hasta 10 fps, la capacidad de grabación de películas 4K y', 9470000, 'Sony', , 1);
INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(4, 'Barra de Sonido', 'Número de canales: 2.1. Número de altavoces: 3 Altavoz. Tipo de Subwoofer (Activo / Pasivo / Inalámbrico / Integrado): Inalámbrico\r\nCaracterísticas de audio; Dolby: Dolby 2 canales. Night Mode: Sí', 522405, 'Samsung', , 1),
(5, 'Play Station 5 pro', 'Con PlayStation®5 Pro, los creadores de juegos más importantes pueden mejorar sus juegos con increíbles funciones como trazado de rayos avanzado, claridad de imagen supernítida para TV 4K y partidas con alta velocidad de fotogramas*.', 4079900, 'Sony', , 1),
(6, 'Kia Carens', 'Llantas en buen estado, todos los mantenimientos en taller autorizado Kia, nunca chocado, única dueña, bajo consumo de gasolina, amplio espacio de baul, 150 hp, SOAT y tecnico mecánica hasta junio de 2025.', 54000000, 'Kia', , 2);
INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(7, 'Ford Ranger 3.2', 'La Ford Ranger es una camioneta pickup robusta y versátil, ideal tanto para trabajo como para aventuras al aire libre. Ofrece un buen rendimiento en carretera y en terrenos difíciles, además de contar con opciones de motor eficientes. Su interior es cómod', 185000000, 'Ford', , 2),
(8, 'Toyota Fortuner 2.8', 'La Toyota Fortuner es una SUV espaciosa y resistente, ideal para familias y terrenos variados. Equipada con un potente motor y tracción en las cuatro ruedas, ofrece un manejo seguro y confiable. Su interior es cómodo y cuenta con tecnología moderna, ademá', 172000000, 'Toyota', , 2);
INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(9, 'Jeep Cherokee 4.0', 'Vehiculó en excelente estado. Exploradoras en el techo. Parrilla porta equipaje. Documentos al día. Venta directa con el propietario. Vehiculó original', 25000000, 'Jeep', , 2),
(10, 'Chevrolet Camaro 2', 'El Chevrolet Camaro es un icónico deportivo de alto rendimiento, diseñado para brindar una experiencia de conducción emocionante. Con su motor potente y diseño aerodinámico, ofrece aceleración y maniobrabilidad excepcionales. Su interior es moderno y orie', 200000000, 'Chevrolet', , 2);
INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(11, 'Cafetera Imusa', 'Los amantes del café quieren disfrutar de su bebida favorita en cualquier momento, en cualquier lugar. Ahora con nuestra Cafetera IMUSA Cafe City con capacidad de 6 tazas podrás disfrutar de la bebida más deliciosa del mundo. Su sistema antigoteo te permi', 79900, 'Imusa', , 3),
(12, 'Wafflera electrica', 'Posee placas de cocción de teflón. La gran ventaja: es muy fácil de limpiar. Además, resiste a las altas temperaturas y no requiere ningún tipo de grasa o aceite al momento de cocinar los waffles', 29062, 'Sokany', , 3);
INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(13, 'Licuadora Imusa', 'Un electrodoméstico infaltable en tu casa. La licuadora Imusa Infiny Force 10 te ayudará a obtener resultados increíbles en todo lo que prepares, ya sea que quieras disfrutar de una bebida bien fría, de salsas y sopas, o de postres deliciosos. ¡Tenla siem', 124900, 'Imusa', , 3),
(14, 'Exprimidor electrico', 'Disfrute de la frescura y el sabor puro de los jugos cítricos recién exprimidos con el Exprimidor de Cítricos y Extractor de Jugos Cuisinart - CCJ-500. Diseñado para los amantes de la vida saludable y los sabores naturales, este electrodoméstico es un ali', 259900, 'Cuisinart', , 3),
(15, 'Freidora de aire', 'El Horno + Freidora de Aire Digital 12L de MasterChef® permite sustituir múltiples electrodomésticos gracias a su Panel Touch intuitivo con 10 funciones preestablecidas que facilitan la preparación de alimentos mediante: Freír con aire, tostar, hornear, r', 537000, 'Master Chef', , 3);
INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(16, 'Banco Multifuncional', '¡Descubre el Banco Magnux Multiposicional! Tu compañero ideal para esculpir un abdomen de acero, fortalecer la zona lumbar y desafiar tus límites en cada entrenamiento.', 499900, 'Magnux', , 4),
(17, 'Eliptica 7 Bicicleta estatica', 'Ejercicio Integral: Ideal para ejercitar muslos, pantorrillas, brazos, espalda y zona abdominal. Cardiovascular y Tonificación: Combina ejercicio cardiovascular con tonificación de músculos. Quema de Calorías: Diseñado para quemar calorías eficientemente.', 874700, 'Home Sale', , 4);
INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(18, 'Bicicleta Spinning', 'Bicicletas spinning de banda Sportfitness ideal para tu entrenamiento cardiovascular. Beneficios como la tonificación del cuerpo, quema de calorías, y prevención de enfermedades. Diseño compacto y económico.', 749900, 'Sport Fitness', , 4);
INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(19, 'Trampolín aeróbico', 'Ofrece una forma efectiva, segura y progresiva de ejercitarte. Intensidad, equilibrio y agilidad, tono, y acondicionamiento para tus principales grupos musculares.', 184900, 'Magnux', , 4),
(20, 'Kit de pesas', 'El entrenamiento con pesas es uno de los deportes de fuerza más eficaces y es también muy bueno en el área de la salud y buen estado físico, así como para la rehabilitación. Los músculos se fortalecen y simultáneamente se moldean con el uso de las pesas. ', 132860, 'Mancuernas', , 4);
