INSERT INTO `productos` (`id`, `nombre_producto`, `descrip_producto`, `valor`, `marca`, `imagen`, `id_usuario`) VALUES
(22, 'Juego de Herramientas', 'Facilita los trabajos de mantención del hogar con el Juego De Copas Profesional Universal Brooklyn 45 Piezas, sin ocupar espacio innecesario. Este conjunto te permite realizar reparaciones de diversos niveles, tanto en el ámbito doméstico como en el profe', 39990, 'Brooklyn', , 5),
(23, 'Hidro lavadora Eléctrica', 'Con tu hidrolavadora puedes dejar reluciente cualquier material o superficie. Su rocío de agua de alta presión es entre diez y cincuenta veces más potente que las mangueras de jardín, lo que hace más eficaz y fácil el proceso de limpieza.', 349900, 'Express', , 5);
