(24, 'Careta para Soldar Inteligente', 'La careta FURIUS FW35 posee doble sensor foto sensible que favorece a una mejor detección del arco. Es ligera y confortable, ideal para largas jornadas de trabajo y evita fatiga y dolores corporales causados por peso excesivo en la careta.', 85173, 'Fenix', , 5),
(25, 'Batería Power x-change', 'La batería Power X-Change es una batería recargable y versátil, compatible con una amplia gama de herramientas de la línea Power X-Change. Ofrece larga duración, carga rápida y un diseño compacto y duradero. Ideal para quienes buscan eficiencia y flexibil', 86913, 'Einhell', , 5);
